import React from 'react';
import Login from '../components/Login';
import Signup from '../components/Signup';

export default class Home extends React.Component {
	render() {
		return (
			<div>
				<Login />
				<SignUp />
				<h2>Hello World!</h2>
				<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Nec nam aliquam sem et tortor. Enim nulla aliquet porttitor lacus luctus accumsan tortor. Enim lobortis scelerisque fermentum dui faucibus in. Nunc id cursus metus aliquam eleifend mi. Tempus imperdiet nulla malesuada pellentesque elit eget gravida. Velit euismod in pellentesque massa placerat duis ultricies lacus sed. Eu ultrices vitae auctor eu augue ut. Semper risus in hendrerit gravida rutrum quisque non tellus. Nullam non nisi est sit amet facilisis magna etiam tempor. Morbi non arcu risus quis varius. Eget nullam non nisi est sit amet facilisis magna etiam. Non curabitur gravida arcu ac tortor. Urna et pharetra pharetra massa massa ultricies mi quis hendrerit. A cras semper auctor neque vitae tempus quam pellentesque nec. Enim lobortis scelerisque fermentum dui faucibus in ornare quam viverra.</p>
				<p>Enim sed faucibus turpis in eu mi bibendum neque. Libero id faucibus nisl tincidunt eget. Blandit massa enim nec dui nunc mattis enim. Varius quam quisque id diam vel. In est ante in nibh mauris cursus mattis. Facilisi etiam dignissim diam quis enim lobortis. Quis varius quam quisque id diam vel quam elementum. Senectus et netus et malesuada fames ac turpis egestas. Integer malesuada nunc vel risus commodo viverra maecenas accumsan lacus. Id donec ultrices tincidunt arcu non sodales neque sodales ut. Pellentesque id nibh tortor id aliquet lectus proin nibh nisl. Risus feugiat in ante metus dictum. Vestibulum rhoncus est pellentesque elit ullamcorper dignissim cras.</p>
				<p>Nec dui nunc mattis enim ut. Sed adipiscing diam donec adipiscing tristique risus nec. Varius quam quisque id diam vel quam elementum pulvinar etiam. Eu facilisis sed odio morbi quis commodo odio. Amet mattis vulputate enim nulla aliquet porttitor. Varius duis at consectetur lorem donec massa sapien faucibus et. Ultrices eros in cursus turpis massa tincidunt dui ut ornare. Scelerisque varius morbi enim nunc faucibus. Neque viverra justo nec ultrices dui sapien eget mi. Blandit aliquam etiam erat velit scelerisque in. Purus viverra accumsan in nisl nisi scelerisque. Orci a scelerisque purus semper eget. Gravida in fermentum et sollicitudin. Quam elementum pulvinar etiam non quam lacus suspendisse faucibus. Quam vulputate dignissim suspendisse in est ante.</p>
			</div>
		);
	}
}
